We can run the CYK procedure on the 4‐token input t37 t16 t56 t12.

1.  Fill in the “length–1” table entry for each position  
   • t37 ⇒ {NT88}  
   • t16 ⇒ {NT54}  
   • t56 ⇒ {NT90, NT28}  
   • t12 ⇒ {NT13}  

2.  Length–2 spans:  
   [1–2]=t37 t16: only pair (NT88, NT54) – no A→NT88 NT54, so ∅  
   [2–3]=t16 t56: pairs (NT54, NT90), (NT54, NT28) – only NT68→NT54 NT28, so {NT68}  
   [3–4]=t56 t12: pairs (NT90, NT13), (NT28, NT13) – no matches, so ∅  

3.  Length–3 spans:  
   [1–3]=t37 t16 t56: splits give no nonterminals, so ∅  
   [2–4]=t16 t56 t12: split at 2 gives ∅; split at 3 gives NT26→NT68 NT13, so {NT26}  

4.  Full span [1–4]:  
   split at 1 gives NT88∈[1–1] and NT26∈[2–4], and S→NT88 NT26, so S covers the whole string.

Hence the grammar does generate t37 t16 t56 t12.  
