To check, we run the CYK algorithm over the 11‐token string.  At the bottom level (span = 1) we get

1: t21 → {NT11}  
2: t19 → {NT17}  
3: t32 → {NT72}  
4: t32 → {NT72}  
5: t17 → {NT12, NT11}  
